<?phpdeclare(strict_types=1);use App\Military\Entity\Units\Units;use App\Military\Entity\Units\UnitsRepository;use Doctrine\ORM\EntityManagerInterface;use Doctrine\ORM\EntityRepository;use Psr\Container\ContainerInterface;return [    UnitsRepository::class => function(ContainerInterface $container): UnitsRepository {        $em = $container->get(EntityManagerInterface::class);        /**         * @var EntityRepository $repo         * @psalm-var EntityRepository<Units> $repo         */        $repo = $em->getRepository(Units::class);        return new UnitsRepository($em, $repo);    },];